import './footer.css';
import htmlcourselink from "./htmlcourselink";
import contactUs from "./ContactUs";

function Footer() {
    const contactusLinks = contactUs.map(contactUsItem => {
        return (
            <a className="readmore" onClick={onNav} key={contactUsItem.title} href={contactUsItem.url} data-target={contactUsItem.title}>Contact Us </a>

        );
    });
    return (
        <footer className="footer">
            <ul className="footerlinks">
                <li className="footerlinks__item"><a href="privacy.html">Privacy</a></li>
                <li className="footerlinks__item"><a href="contactus.html">{contactusLinks}</a></li>
                <li className="footerlinks__item"><a href="terms.html">Terms of Use</a></li>

            </ul>
        </footer>
    );
}

export default Footer;
